import React from 'react';

function Experience() {
  return (
    <>
      <style>
        {`
          .container {
            display: flex;
            justify-content: start;
            padding-left: 10rem; /* Default padding */
            background-color: #ffffff;
            color: #333333;
            font-family: 'Roboto, Arial, sans-serif';
            min-height: 80rem;
          }

          .timelineContainer {
            max-width: 700px;
            padding: 1.5rem;
          }

          .sectionTitle {
            font-size: 2rem;
            font-weight: bold;
            color: #333333;
            margin-bottom: 1.5rem;
          }

          .timeline {
            position: relative;
            padding-left: 18px;
            border-left: 2px solid #cccccc;
            margin-bottom: 3rem;
          }

          .timelineItem {
            display: flex;
            align-items: flex-start;
            margin-bottom: 2.5rem;
          }

          .marker {
            width: 10px;
            height: 10px;
            background-color: #333333;
            border-radius: 50%;
            position: relative;
            left: -20px;
            top: 8px;
          }

          .card {
            background-color: #ffffff;
            color: #333333;
            border-radius: 6px;
            padding: 1rem;
            box-shadow: 0px 3px 8px rgba(0, 0, 0, 0.1);
            max-width: 550px;
            width: 100%;
            transition: transform 0.3s ease, box-shadow 0.3s ease;
            cursor: pointer;
          }

          .card:hover {
            transform: scale(1.05);
            box-shadow: 0 0.5rem 1rem rgba(0, 0, 0, 0.2);
          }

          .date {
            font-size: 1rem;
            color: #666666;
            margin-bottom: 0.6rem;
          }

          .cardTitle {
            font-size: 1.4rem;
            font-weight: bold;
            color: #333333;
            margin-bottom: 0.6rem;
          }

          .cardSubtitle {
            font-size: 1rem;
            font-style: italic;
            color: #666666;
            margin-bottom: 1rem;
          }

          .cardDescription {
            font-size: 0.9rem;
            line-height: 1.8;
          }

          /* Media Query for Mobile Devices */
          @media (max-width: 768px) {
            .container {
              padding-left: 1rem; /* Reduced padding on smaller screens */
              padding-right: 1rem;
            }

            .sectionTitle {
              font-size: 1.5rem; /* Adjust font size for smaller screens */
            }

            .cardTitle {
              font-size: 1.2rem; /* Adjust font size for smaller screens */
            }

            .cardSubtitle,
            .date,
            .cardDescription {
              font-size: 0.9rem; /* Adjust font size for smaller screens */
            }
          }
        `}
      </style>

      <div className="container">
        <div className="timelineContainer">
          <h1 className="sectionTitle">Education</h1>
          <div className="timeline">
            <div className="timelineItem">
              <div className="marker"></div>
              <div className="card">
                <p className="date">2022 - 2026</p>
                <h2 className="cardTitle">Georgia Institute of Technology</h2>
                <p className="cardSubtitle">Bachelor of Science in Computer Science</p>
                <p className="cardDescription">
                  Thread in System & Architecture and Intelligence
                </p>
              </div>
            </div>
          </div>

          <h1 className="sectionTitle">Extracurriculars</h1>
          <div className="timeline">
            <div className="timelineItem">
              <div className="marker"></div>
              <div className="card">
                <p className="date"></p>
                <h2 className="cardTitle">Automated Algorithm Design</h2>
                <p className="cardSubtitle">Undergraduate Machine Learning Researcher</p>
                <p className="cardDescription">
                  Accelerate NAS by developing surrogate models to predict network performance, reducing computational costs by approximating architecture evaluation across search spaces.
                </p>
              </div>
            </div>

            <div className="timelineItem">
              <div className="marker"></div>
              <div className="card">
                <p className="date"></p>
                <h2 className="cardTitle">Trading Club at Georgia Tech</h2>
                <p className="cardSubtitle">Quantitative Research Analyst</p>
                <p className="cardDescription">
                  Research low-cap cryptocurrency capturing alpha during high liquidity movements, capturing assets in sudden liquidity gaps.
                </p>
              </div>
            </div>

            <div className="timelineItem">
              <div className="marker"></div>
              <div className="card">
                <p className="date">Summer 2023</p>
                <h2 className="cardTitle">CEISMC</h2>
                <p className="cardSubtitle">Summer Intern</p>
                <p className="cardDescription">
                  Robotics bootcamp and activities for 20+ motivated high school students interested in Georgia Tech.
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Experience;
